import React, { Component } from 'react';

class PhotoSet extends Component {
  render() {
    const project = this.props.project;

    return (
      <div
      className="PhotoSet"
      id={project.id}
      >
      <h2>{project.title}</h2>
      </div>
    );
  }
}

export default PhotoSet;
